private E unlinkLast() {
    final Node<E> l = last;
    if (l == null) {
        return null;
    }
    final Node<E> p = l.prev;
    final E item = l.item;
    l.item = null;
    l.prev = l; // help GC
    last = p;
    if (p == null) {
        first = null;
    } else {
        p.next = null;
    }
    --count;
    notFull.signal();
    return item;
}

private E unlinkFirst() {
    final Node<E> f = first;
    if (f == null) {
        return null;
    }
    final Node<E> n = f.next;
    final E item = f.item;
    f.item = null;
    f.next = f; // help GC
    first = n;
    if (n == null) {
        last = null;
    } else {
        n.prev = null;
    }
    --count;
    notFull.signal();
    return item;
}

private void unlink(final Node<E> x) {
    final Node<E> p = x.prev;
    final Node<E> n = x.next;
    if (p == null) {
        unlinkFirst();
    } else if (n == null) {
        unlinkLast();
    } else {
        p.next = n;
        n.prev = p;
        x.item = null;
        --count;
        notFull.signal();
    }
}

