private boolean linkLast(final E e) {
    if (count >= capacity) {
        return false;
    }
    final Node<E> l = last;
    final Node<E> x = new Node<>(e, l, null);
    last = x;
    if (first == null) {
        first = x;
    } else {
        l.next = x;
    }
    ++count;
    notEmpty.signal();
    return true;
}

private boolean linkFirst(final E e) {
